		//PREP THE STAGE
		function init(){//This init is global for the project. Don't worry about adding anything in this section to your project besides for testing.
			createjs.Ticker.addEventListener("tick", gameUpdate); //called the gameUpdate function constantly
			stage.addChild(inventory);
			inventory.y = 720;
			
			destination.x = 25; //this will need to be changed when you have an object already in your inventory
			destination.y = 745;
			destination.setBounds(25, 745, squareHeight, squareWidth); //this will also need to be changed
			dragger.setBounds(0, 0, dragRadius*2, dragRadius*2);
			stage.addChild(destination, dragger);
			stage.mouseMoveOutside = true;
			
			
			dragger.on("pressmove", function(evt){
				if (draggerLock == false){
					evt.currentTarget.x = evt.stageX;
					evt.currentTarget.y = evt.stageY;
					stage.update(); //much smoother because it refreshes the screen every pixel movement instead of the FPS set on the Ticker
					if(intersect(evt.currentTarget, (destination))){
						evt.currentTarget.alpha=0.2;
					}else{
						evt.currentTarget.alpha=1;
					}
				}
			});
		
			//Mouse UP and SNAP====================
			dragger.on("pressup", function(evt) {
			  if(intersect(evt.currentTarget, destination)){
				dragger.x = destination.x + squareWidth/2;
				dragger.y = destination.y + squareHeight/2;
				dragger.alpha = 1;
				dropSound.play();
				if (draggerLock == false){
					// WATER
					if (scubaTest == true){
						scubaCollected = true;
						scubaTest = false;
					}
					if (crabAdded == true){
						walkingBackScuba();
						crabAdded = false;
					}
					if (keyUnlocked == true){
						walkingIntoCove();
						draggerLock = false;
						keyUnlocked = false;
					}
					
					//EARTH
					if (firstLadder == true) {
						ladderCollected = true;
						firstLadder = false;
					}
					if (secondLadder == true){
						//dragger.alpha = 0;
						ladderPlaced = true;
						draggerLock = false;
						dragger.removeChild(ladderThumb);
						secondLadder = false;
					}
		
					//AIR
					if (closedUmbrellaAdded == true){
						umbrellaAdded = true;
						closedUmbrellaAdded = false;
					}
					
					//FIRE
					if (ropeOnRock == true && ropeCollected == true){
						tieRope();
						ropeOnRock = false;
					}
					if (rope2dragAdded == true) {
						ropeAdded = true;
						rope2dragAdded = false;
					}
					draggerLock = true; // a way to stop your item from being dragged again after dropping
				}
				
				stage.update(evt);
			  }
			});	
			console.log("init");
			resetScene(); //used to get the scene ready and make sure nothing is on it.
		}
		
